import React,{useState, useEffect} from "react";
import Card from './Card';
import {robots} from './robots';



const CardList=()=>{

	return (

		<div>
			robots.map(ro=>{
				<Card robot={ro} />
			})
		</div>		
	);
}

export default CardList;
